import React, {Component} from 'react';
import {TopicWrapper,
    TopicItem} from '../style';

class Topic extends Component {
    render() {
        return (
            <TopicWrapper>
                <TopicItem></TopicItem>
            </TopicWrapper>
        )
    }
}

export default Topic;
